import React, { Component } from 'react';

class Remote extends Component {
  yell = () => {
    console.log('hello');
  };
  render() {
    return (
      <div className="container-fluid">
        <button onClick={() => this.yell()}>Up</button>
      </div>
    );
  }
}

export default Remote;
